import React, { useState } from "react";
import { Container, IconContainer, MobileContainer,Icon, CatImg } from "./AppStyle";
import Cat from './cat.jpg'

const App =()=>{

  return(
    <Container>
       <MobileContainer>
         <IconContainer>
          <Icon.Arrow /> 
          <Icon.Switch />
         </IconContainer>

         <CatImg src={Cat} alt='cat' />
       </MobileContainer>
    </Container>

  )
}


export default App;
